import React from "react";

const TableHeader = () => {
  return (
    <thead>
      <tr>
        <th>Name</th>
        <th>House</th>
      </tr>
    </thead>
  );
};

const TableBody = () => {
  return <tbody />;
};

class Table extends React.Component {
  render() {
    const { studentData } = this.props;
    return (
      <table>
        <TableHeader />
        <TableBody studentData={studentData} />
      </table>
    );
  }
}

export default Table;
